/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `旅游费用_after_insert_旅游信息` AFTER INSERT ON `旅游信息` FOR EACH ROW BEGIN
    DECLARE 价格 FLOAT;

    SELECT 旅游时间段.价格
    INTO 价格
    FROM 旅游时间段
             JOIN 旅游线路_旅游时间段_旅游信息 ON 旅游时间段.id = 旅游线路_旅游时间段_旅游信息.旅游时间段_id
    WHERE 旅游线路_旅游时间段_旅游信息.旅游信息_id = NEW.id;

    UPDATE 旅游信息
    SET 旅游费用 = 价格
    WHERE id = NEW.id;
END */;;
